import axios from "axios";

export function getCharacters(userId){
     return axios.get(`/api/char/chars/${userId}`);
}

export function deleteCharacter(charId){
     return axios.delete(`/api/char/chars/${charId}`);
}

export function createCharacter(char){
     return axios.post(`/api/char/create-char`, char);
}

export function pushBook(userId, Book){
     return axios.post(`/api/book/${userId}`, Book);
}

export function makeBook(userId){
     return axios.post(`/api/book/:${userId}`);
}

export function getParty(bookId){
     return axios.get(`/api/party/${bookId}`);
}

export function getUser(userId){
     return axios.get(`/api/user/:${userId}`);
}

export function newUser(userId){
     return axios.post(`/api/user/:${userId}`);
}

export function setScreenName(userId, screenNameObj){
     return axios.post(`/api/user/:${userId}`, {screenName: screenNameObj});
}
